-- №1 Описание бд: 
-- Для курсового проекта выбрана торговая онлайн-платформа aliexpress. Aliexpress.ru выбран,
-- в связи с тем, что представляет собой один из наиболее интересных онлайн-ресурсов для анализа: 
-- В базе данных представлены следующие сущности и таблицы связи:
-- 1) Сущность: покупатели;
-- 2) Сущность: профили покупателей;
-- 3) Сущность: поставщики;
-- 4) Сущность: профили поставщиков;
-- 5) Сущность: каталоги с товарами;
-- 6) Сущность: товары;
-- 7) Сущность: заказы;
-- 8) Таблица связи: товары, которыми торгуют поставщики;
-- 9) Сущность: сообщения между покупателями и поставщиками;
-- 10) Сущность: медиафайлы поставщикоа;
-- 11) Сущность: медиафалы покупателей;
-- 12) Сущность: типы медиафайлов;
-- 13) Сущность: отзывы покупателей о товарах;
-- 14) Сущность: скидки на товары у поставщиков;
-- 15) Таблица связи: заказы, размещенные у поставщиков;
-- 16) Таблица связи: скидки, распространяющиеся на товар в заказах


CREATE DATABASE IF NOT EXISTS aliexpress;
USE aliexpress;
DROP TABLE IF EXISTS customers;
CREATE TABLE customers 
	(id INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY,
    first_name VARCHAR(50) NOT NULL,
    last_name VARCHAR(50) NOT NULL,
    email VARCHAR(100) NOT NULL UNIQUE,
    `password` VARCHAR(20) NOT NULL,
    facebook_account VARCHAR(100) UNIQUE,
    gmail_account VARCHAR(100) UNIQUE,
    created_at DATETIME DEFAULT NOW(),
    update_at DATETIME DEFAULT NOW() ON UPDATE NOW()) 
    COMMENT='Таблица содержит основную нформацию о пользователях-покупателях. 
    Аккаунты gmail и facebook включены в таблицу, поскольку покупатель
    может использовать эти данные, чтобы совершать вход в аккаунт';

DROP TABLE IF EXISTS customers_profiles;
CREATE TABLE customers_profiles
	(customer_id INT UNSIGNED NOT NULL UNIQUE,
	sex CHAR(1) NOT NULL,
	birthday DATE NOT NULL,
	country VARCHAR(15) NOT NULL,
	city VARCHAR(15) NOT NULL,
	phone SMALLINT NOT NULL UNIQUE,
	post_code TINYINT,
	media_id INT UNSIGNED,
	created_at DATETIME DEFAULT NOW(),
	updated_at DATETIME DEFAULT NOW() ON UPDATE NOW())
	COMMENT='Таблица профилей покупателей.
	Для столбцов: sex, country, city, birthday - специально выбраны NOT NULL, чтобы не допускать генерацию
	пустых значений на фейкер-сайте';
        
DROP TABLE IF EXISTS suppliers;
CREATE TABLE suppliers
	(id INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY,
	supplier_registration_number INT UNSIGNED NOT NULL UNIQUE,
	supplier_legal_form VARCHAR(100) NOT NULL,
	supplier_full_name VARCHAR(255) NOT NULL,
	supplier_registration_address VARCHAR(500) NOT NULL,
	phone SMALLINT NOT NULL UNIQUE,
	post_code TINYINT,
	email VARCHAR(150) NOT NULL UNIQUE,
	`password` VARCHAR(20) NOT NULL,
	created_at DATETIME DEFAULT NOW(),
	updated_at DATETIME DEFAULT NOW() ON UPDATE NOW())
	COMMENT='Таблица содержит основную информацию о пользователе-поставщике';
        
DROP TABLE IF EXISTS suppliers_profiles;
CREATE TABLE suppliers_profiles
	(supplier_id INT UNSIGNED NOT NULL UNIQUE,
	supplier_short_name INT NOT NULL,
	media_id INT UNSIGNED,
	info_about_the_company TEXT,
	created_at_supplier_id DATETIME DEFAULT NOW(),
	updated_at DATETIME DEFAULT NOW() ON UPDATE NOW())
	COMMENT='Таблица профилей поставщиков. Содержит более подробную информацию о поставщике и 
	предоставляемых услугах';
    
DROP TABLE IF EXISTS catalogs;
CREATE TABLE catalogs
	(id INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY,
	`name` VARCHAR(50) NOT NULL UNIQUE,
	`description` VARCHAR (200) NOT NULL UNIQUE,
    media_id INT UNSIGNED NOT NULL UNIQUE,
	created_at DATETIME DEFAULT NOW(),
	updated_at DATETIME DEFAULT NOW() ON UPDATE NOW())
	COMMENT='Таблица содержит информацию по категориям товаров.';
    
DROP TABLE IF EXISTS products;
CREATE TABLE products
	(id INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY,
	catalog_id INT UNSIGNED NOT NULL,
	`name` VARCHAR(100) NOT NULL,
	`description` VARCHAR (500) NOT NULL,
    price DECIMAL(8,2) NOT NULL,
	media_id INT UNSIGNED NOT NULL,
	created_at DATETIME DEFAULT NOW(),
	updated_at DATETIME DEFAULT NOW() ON UPDATE NOW())
	COMMENT='Таблица товаров'; 
    
DROP TABLE IF EXISTS orders;
CREATE TABLE orders
	(id INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY,
    customer_id INT UNSIGNED NOT NULL,
    delivery_address VARCHAR(150) NOT NULL,
	post_code TINYINT UNSIGNED NOT NULL,
    created_at DATETIME DEFAULT NOW(),
	updated_at DATETIME DEFAULT NOW() ON UPDATE NOW())
    COMMENT='Таблица, содержащая заказы';

DROP TABLE IF EXISTS suppliers_products;
CREATE TABLE suppliers_products
	(id INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY,
    supplier_id INT UNSIGNED NOT NULL,
    product_id INT UNSIGNED NOT NULL,
    total_quantity INT UNSIGNED NOT NULL,
	created_at DATETIME DEFAULT NOW(),
	updated_at DATETIME DEFAULT NOW() ON UPDATE NOW())
    COMMENT='Таблица связи. Товары, которыми торгует поставщик';

DROP TABLE IF EXISTS orders_suppliers_products;
CREATE TABLE orders_suppliers_products
	(order_id INT UNSIGNED NOT NULL UNIQUE,
    supplier_product_id INT UNSIGNED NOT NULL,
    quantity INT UNSIGNED NOT NULL,
    total_price DECIMAL(10,2) NOT NULL,
    PRIMARY KEY(order_id, supplier_product_id))
    COMMENT='Таблица связи. Размещенный у поставщика заказ';
    
DROP TABLE IF EXISTS orders_suppliers_products_discounts;
CREATE TABLE orders_suppliers_products_discounts
	(orders_suppliers_products_id INT UNSIGNED NOT NULL UNIQUE,
    discount_id INT UNSIGNED NOT NULL,
    PRIMARY KEY (orders_suppliers_products_id, discount_id))
    COMMENT='Таблица связи. Связь размещенного у поставщика заказа со скидаками';


DROP TABLE IF EXISTS messages;
CREATE TABLE messages
	(customer_id INT UNSIGNED NOT NULL,
    supplier_id INT UNSIGNED NOT NULL,
    body TEXT NOT NULL,
    is_delivered BOOLEAN,
    created_at DATETIME DEFAULT NOW())
    COMMENT='Таблица сообщений. Коммуникация между поставщиком и покупателем';

DROP TABLE IF EXISTS media_from_suppliers;
CREATE TABLE media_from_suppliers
	(id INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY,
    supplier_id INT UNSIGNED NOT NULL,
    media_type_id INT UNSIGNED NOT NULL,
    file_name VARCHAR(100) NOT NULL,
	size INT NOT NULL,
    created_at DATETIME DEFAULT NOW())
    COMMENT='Таблица с медиафайлами: фото и видео к продуктам, логотипы - поставщиков. 
    Ввиду того, что после создания внешних ключей могут возникнуть сложности в рамках генерации 
    тестовых данных, например поставщик и покупатель с одинаковыми id, пришлось сформировать отдельные
    таблицы медиа для поставщика и покупателя, чтобы не допустить ситуации, что при удалении поставщика
    с определенным id, у покупателя с тем же id не удавлялись медиафайлы';
   

DROP TABLE IF EXISTS media_from_customers;
CREATE TABLE media_from_customers
	(id INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY,
    customer_id INT UNSIGNED NOT NULL,
    media_type_id INT UNSIGNED NOT NULL,
    file_name VARCHAR(100) NOT NULL,
	size INT NOT NULL,
    created_at DATETIME DEFAULT NOW())
    COMMENT='Таблица с медиафайлами: фото и видео с приобретенным товаром, аватары - покупателей';


DROP TABLE IF EXISTS comments;
CREATE TABLE comments
	(id INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY,
    target_id INT UNSIGNED NOT NULL UNIQUE,
    target_type VARCHAR(20) NOT NULL,
    customer_id INT UNSIGNED NOT NULL,
    body TEXT NOT NULL,
    created_at DATETIME DEFAULT NOW(),
    updated_at DATETIME DEFAULT NOW() ON UPDATE NOW())
    COMMENT='Комментарии со стороны пользователей системы (покапатель/поставщик)';
  

DROP TABLE IF EXISTS discounts;
CREATE TABLE discounts
	(id  INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY,
    suppliers_products_id INT UNSIGNED NOT NULL,
    discount FLOAT,
    started_at TIMESTAMP,
	finished_at TIMESTAMP,
	created_at DATETIME DEFAULT NOW(),
    updated_at DATETIME DEFAULT NOW() ON UPDATE NOW())
    COMMENT='Скидка на товары от поставщика';
        

DROP TABLE IF EXISTS media_types;
CREATE TABLE media_types
	(id INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY,
    name_type VARCHAR(20) NOT NULL)
    COMMENT='Справочная таблица со списоком типов медиа. 
    В данной бд, чтобы не "плодить" избыточные сущности предусмотрена только 1 справочная таблица';
    

