-- Представления с применением JOIN:
SHOW tables;
USE aliexpress;
DESC products;
DESC orders_suppliers_products;

CREATE VIEW orders_prices AS SELECT
	orders.id AS order_number, products.id AS product_number, products.name AS product_name, products.price AS price_per_unit,orders_suppliers_products.quantity,  
	products.price*orders_suppliers_products.quantity AS total_price_per_position
		FROM orders
			JOIN orders_suppliers_products
				ON orders.id=orders_suppliers_products.order_id
			JOIN suppliers_products
				ON suppliers_products.supplier_id=orders_suppliers_products.supplier_product_id
			JOIN products
				ON products.id=suppliers_products.product_id
			WITH CHECK OPTION;
 
SELECT*FROM orders_prices;


SELECT*FROM discounts LIMIT 10;
SELECT*FROM orders_suppliers_products LIMIT 10;
SELECT*FROM orders_suppliers_products_discounts LIMIT 10;
 
 
CREATE VIEW orders_with_discounts AS SELECT
	orders.id AS order_number, products.id AS product_number, products.name AS product_name, products.price AS price_per_unit, discounts.discount AS product_discount,  
	products.price*(1-discounts.discount/100) AS price_with_discount, orders_suppliers_products.quantity, products.price*orders_suppliers_products.quantity AS total_price_per_position_without_discount, products.price*(1-discounts.discount/100)*orders_suppliers_products.quantity AS total_price_per_position_with_discount
		FROM orders
			JOIN orders_suppliers_products
				ON orders.id=orders_suppliers_products.order_id
			JOIN suppliers_products
				ON suppliers_products.supplier_id=orders_suppliers_products.supplier_product_id
			JOIN products
				ON products.id=suppliers_products.product_id
			JOIN orders_suppliers_products_discounts
				ON orders_suppliers_products_discounts.orders_suppliers_products_id=orders_suppliers_products.order_id
			JOIN discounts
				ON discounts.id=orders_suppliers_products_discounts.discount_id
                WITH CHECK OPTION;


SELECT*FROM orders_with_discounts;
