-- скрипты характерных выборок (включающие группировки, JOIN'ы, вложенные таблицы)
/*Некоторые виды операций были продемонстрированы выше, например JOIN'ы были использованы при создании
представлений, вложенные таблицы были использованы в запросах согласования данных между таблицами.
Поэтому ниже будет данно по одному примеру  сриптов характерных выборок.*/

SELECT*FROM orders LIMIT 10;

-- 10 покупателей, совершивших наибольшее количество заказов. Не смотря на то, что отсутствуют покупатели,
-- совершившие более 1 заказа, скрипт ниже работает корректно.
 
 SELECT 
	(SELECT CONCAT(first_name,' ',last_name) FROM customers
		WHERE id=orders.customer_id) customer_name, COUNT(*) number_of_orders_per_customer
	FROM orders
		WHERE customer_id IN 
			(SELECT id FROM customers)
            GROUP BY customer_id
            ORDER BY number_of_orders_per_customer DESC
            LIMIT 10;
            
            
-- Топ 5 покупателей заплативших с учетом скидки наибольшую цену за совершенные заказы:
SELECT CONCAT(first_name,' ',last_name) customer_name, SUM(total_price_per_position_with_discount) paid_with_discount_by_customer
	FROM  orders_with_discounts
	JOIN orders
		ON orders.id=orders_with_discounts.order_number
	JOIN customers
		ON customers.id=orders.customer_id
	GROUP BY customer_name
    ORDER BY paid_with_discount_by_customer DESC
    LIMIT 5;

-- Хранимые процедуры и функции:

-- Были созданы дополнительные представления для работы с процедурами и функциями, чтоб не менять значения в первоначальных таблицах:
DELIMITER $$
CREATE VIEW altered_customers AS SELECT 
	id,first_name,last_name,email,password,facebook_account,gmail_account,created_at, updated_at
		FROM customers
			WITH CHECK OPTION$$
SELECT*FROM altered_customers$$

-- Процедура изменение паролей пользователей:
DROP PROCEDURE IF EXISTS procedure_change_password$$
CREATE PROCEDURE procedure_change_password()
BEGIN
	DECLARE val INT DEFAULT 1;
	WHILE val < (SELECT MAX(id) FROM altered_customers) DO
		UPDATE altered_customers SET `password`=LEFT(UUID(), FLOOR(RAND()*(12)))
			WHERE id=val;
	SET val=val+1;
	END WHILE;
END$$

CALL procedure_change_password()$$
SELECT*FROM  altered_customers$$


CREATE VIEW altered_customers_profiles AS SELECT
	customer_id,sex,birthday,country,city,phone,post_code,media_id,created_at,updated_at
		FROM customers_profiles$$

SELECT*FROM altered_customers_profiles LIMIT 20$$

-- Процедура изменение даты рождения пользователей:
DROP PROCEDURE IF EXISTS change_birthdate$$
CREATE PROCEDURE change_birthdate()
BEGIN
	DECLARE val INT DEFAULT 10;
    cycle_1: WHILE val BETWEEN 10 AND 50 DO
		IF val%2=0 THEN
			UPDATE altered_customers_profiles SET birthday='1960-01-01' + interval rand()*10000 day
				WHERE customer_id=val;
			SET val=val+1;
		ELSE
			SET val=val+1;
			ITERATE cycle_1;
		END IF;
	END WHILE cycle_1;
END$$


CALL change_birthdate()$$

SELECT*FROM altered_customers_profiles LIMIT 60$$

-- Триггеры:
DROP TRIGGER IF EXISTS no_deletion$$
CREATE TRIGGER no_deletion BEFORE DELETE ON orders_suppliers_products
FOR EACH ROW
BEGIN 
	DECLARE val INT;
    SELECT COUNT(*) INTO val FROM orders_suppliers_products;
	IF val<=(SELECT COUNT(*) FROM orders_suppliers_products) THEN
		SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Please consider the necessity of deletion';
	END IF;
END$$

DELETE FROM orders_suppliers_products WHERE order_id=133$$